import { Grid } from '@material-ui/core';
import React from 'react';

import { sections } from '../../src/directory.data';

export const HomePage = () => {
  return (
    <Grid container justify='space-around'>
      {sections.map((sec) => (
        <Grid
          key={sec.id}
          item
          sm={4}
          xs={12}
          style={{ backgroundColor: 'red' }}
        >
          {sec.title}
        </Grid>
      ))}
    </Grid>
  );
};
